class UIElement {
    constructor (parent,tagName,id,class_,style,content) {
     this.parent = parent;
     this.tagName = tagName;
     this.id = id;
     this.style = style;
     this.class = class_;
     this.content = content;
    }
    render () {
        let element = document.createElement(this.tagName);
        if ( this.id ) element.id = this.id;
        if ( this.class ) element.className = this.class;
        if ( this.style ) element.style = this.style;
        if ( this.content ) element.textContent = this.content;
        this.parent.appendChild(element);
        this.element = element;
        return element;
    }
}

